import React from 'react';

const Home = () => (
	<ul>
  <li> <Link to="/">Home</Link> </li>
<li> <Link to="/messages">Messages</Link> </li>
<li> <Link to="/about">About</Link> </li>
<li>
    <a href="/messages">Messages (with a regular anchor element)</a>
  </li>
</ul>
);

export default Home;
